                var html_3ef1cdc92a6344109f5d10d575ca3a7f = $('<div id="html_3ef1cdc92a6344109f5d10d575ca3a7f" style="width: 100.0%; height: 100.0%;">     <h1>Palma Chilena</h1><br>     Especie cuyo nombre científico es Jubaea chilensis , pertenece a la familia de las palmáceas, es la palma más austral del mundo y es endémica (nativa) de nuestro país. Se distribuye en forma natural entre La Serena y Talca, aproximadamente; encontrándose algunos ejemplares hasta la zona de Arauco.  Se reconoce porque es la única palmera de tronco liso, además presenta un angostamiento a los ocho a diez metros de altura, que ocurre al llegar a la madurez.     <p>     <code>         Pagina de interes         http://www.profesorenlinea.cl/flora/PalmaChil.htm <br>     </code>     </p>     </div>')[0];
